INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (1, 'Programación Orientada a Objetos', 'Estudio de los principios de la programación orientada a objetos utilizando lenguajes como Java o C#.', 7);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (2, 'Bases de Datos I', 'Introducción al diseño, modelado e implementación de bases de datos relacionales con SQL.', 10);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (3, 'Estructuras de Datos', 'Análisis y aplicación de estructuras como listas, pilas, colas, árboles y grafos.', 11);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (4, 'Redes de Computadoras', 'Fundamentos de redes de datos, modelos OSI y TCP/IP, direccionamiento y protocolos de comunicación.', 12);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (5, 'Sistemas Operativos', 'Conceptos de procesos, concurrencia, manejo de memoria, sistemas de archivos y administración de recursos.', 15);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (6, 'Desarrollo Web', 'Diseño y desarrollo de aplicaciones web con tecnologías HTML, CSS, JavaScript y frameworks modernos.', 24);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (7, 'Inteligencia Artificial', 'Introducción a los algoritmos y técnicas de IA como búsqueda, lógica, redes neuronales y aprendizaje automático.', 25);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (8, 'Cálculo Diferencial', 'Estudio de funciones, límites, derivadas y aplicaciones del cálculo en una variable.', 29);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (9, 'Física General', 'Fundamentos de la física clásica: mecánica, termodinámica, electricidad y magnetismo.', 31);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (10, 'Algoritmos y Lógica de Programación', 'Desarrollo de habilidades para resolver problemas mediante algoritmos y estructuras básicas de control.', 34);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (11, 'Ética Profesional', 'Análisis de dilemas éticos en la práctica profesional y responsabilidad social del ingeniero.', 37);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (12, 'Administración de Proyectos', 'Gestión de proyectos de software utilizando metodologías ágiles y herramientas de planificación.', 39);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (13, 'Ingeniería de Software', 'Estudio del ciclo de vida del software, análisis, diseño, pruebas y mantenimiento.', 42);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (14, 'Arquitectura de Computadoras', 'Estructura interna de los computadores: CPU, memoria, buses y ensamblador.', 43);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (15, 'Seguridad Informática', 'Principios y prácticas para proteger sistemas de información ante amenazas y vulnerabilidades.', 45);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (16, 'Matemática Discreta', 'Lógica, conjuntos, relaciones, funciones, grafos y métodos de conteo aplicados a la informática.', 46);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (17, 'Análisis de Sistemas', 'Recolección y análisis de requerimientos para el desarrollo de sistemas de información.', 59);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (18, 'Gestión de la Información', 'Procesos y herramientas para capturar, organizar y analizar información digital.', 60);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (19, 'Minería de Datos', 'Técnicas para descubrir patrones útiles en grandes volúmenes de datos utilizando algoritmos avanzados.', 61);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (20, 'Diseño de Interfaces de Usuario', 'Principios de diseño centrado en el usuario, usabilidad y prototipado de interfaces gráficas.', 63);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (21, 'Modelado de Datos', 'Diseño lógico y físico de datos mediante modelos entidad-relación y normalización.', 68);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (22, 'Desarrollo de Aplicaciones Móviles', 'Creación de aplicaciones móviles para Android e iOS con frameworks como React Native o Flutter.', 70);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (23, 'Ingeniería de Requisitos', 'Técnicas para la recopilación, documentación y validación de requisitos de software.', 72);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (24, 'Computación en la Nube', 'Arquitectura, modelos de servicio y despliegue de aplicaciones en entornos cloud como AWS o Azure.', 75);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (25, 'Fundamentos de Machine Learning', 'Conceptos y algoritmos esenciales para que las computadoras aprendan de datos.', 76);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (26, 'Taller de Programación Web', 'Aplicación práctica de técnicas de desarrollo frontend y backend en proyectos web.', 79);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (27, 'Simulación y Modelado', 'Modelado de sistemas reales mediante simulaciones computacionales y análisis de resultados.', 80);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (28, 'Computación Gráfica', 'Técnicas para generar y manipular gráficos en 2D y 3D con algoritmos visuales.', 82);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (29, 'Criptografía y Seguridad de Redes', 'Estudio de técnicas criptográficas y mecanismos de protección de datos en redes de comunicación.', 83);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (30, 'Sistemas Distribuidos', 'Arquitectura y programación de sistemas distribuidos con múltiples nodos interconectados.', 84);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (31, 'Robótica y Automatización', 'Fundamentos del diseño y control de sistemas robóticos y automatización de procesos.', 91);
INSERT INTO curso (id, titulo, descripcion, docente_id) VALUES (32, 'Big Data y Análisis Avanzado', 'Procesamiento y análisis eficiente de grandes volúmenes de datos usando herramientas modernas.', 100);
